    false,nt"url": null,nt"notes": "The workshop described in this report was
    convened as one of the initial steps in planning appropriate research and monitoring
    activities and integrating them into overall management of the Refuge. Given their
    expertise, workshop participants felt that their time would be most profitably spent
    discussing the first three of these general types of research, which are covered
    in the following sections of this report. In addition, participants felt that it
    was important to discuss management of research (e.g., setting priorities, developing
    standard protocols, developing strategies for data management), which is the subject
    of the final section.",nt"license_title": "License Not Specified",nt"extras":
